import React from 'react';
import './Avatar.css';

function Avatar(avatar){

    const name = avatar.name;
    const image = avatar.image
    const quote = avatar.quote


    return(
        <div>
            <div>
                {name}
            </div>
            <img src={image} />
            <blockquote>
                {quote}
            </blockquote>
        </div>

    )
}

export default Avatar;
